description:
संखुवासभामा एक पुरुषको हत्या गरेको आरोप एक जना पक्राउ परेका छन् ।&amp;nbsp;

चैनपुर नगरपालिका-१० इखम्बु बस्ने ४७ वर्षीय लिला प्रसाद राईको हत्या गरेको आरोपमा सोही ठाउँ बस्ने ५९ वर्षीय शिव कुमार राई पक्राउ परेका हुन् ।

उनलाई प्रहरी शनिबार दिउँसो पक्रा

नेपाली बजारमा आइतबार सुनको मूल्य घटेको छ ।&amp;nbsp;

आइतबार सुनको मूल्य तोलामा १८ हजार ८०० रूपैयाँले घटेको नेपाल सुनचाँदी व्यवसायी महासंघले जनाएको छ ।&amp;nbsp;

यससँगै सुनको मूल्य तोलाको तीन लाख रूपैयाँमा झरेको छ ।&amp;nbsp;

पछिल्लो समय बढिरहेको स

आगामी फागुन २१ गते हुने प्रतिनिधिसभा सदस्य निर्वाचनका लागि बैतडीमा एक हजार ४०० बढी कर्मचारी परिचालन हुने भएको छ ।

जिल्ला निर्वाचन कार्यालयका अनुसार २१४ मतदान केन्द्रमा एक हजार ४४२ जना कर्मचारी खटाइने भएको हो ।&amp;nbsp;

निर्वाचनमा कर्मचारी परिचालनक

दीपक चन्द/रासस &amp;nbsp; &amp;nbsp;


आगामी फागुन २१ गते हुने प्रतिनिधिसभा सदस्य निर्वाचनका लागि उम्मेदवारहरूको मनोनयन दर्ता भएसँगै देशका अधिकांश शहरी तथा ग्रामीण क्षेत्रमा चुनावी चहलपहल बढ्न थालेको छ ।&amp;nbsp;

सामाजिक सञ्जालदेखि चिया पसल, चौतारी
